import React from 'react';
import {NavLink} from 'react-router-dom'
import web from '../src/images/dt.jpg';
import Common from './Common';

const Home = () => {
  return (
    <>
    <Common name= ''  
        imgsrc={web}
        visit= '/ContactUs'
        btname= "Contact Now"
      />
    </>
  )
};

export default Home;
